import React from "react";

const LobbyScreen = () =>{
  return (
    <div>
      <h1>Lobby</h1>
      <form>
        <label htmlFor="email">Email ID</label>
        <input type="email" id="email"/>
        <label htmlFor="email">Room No</label>
        <input type="text" id="room"/>
      </form>
    </div>
  );
};

export default LobbyScreen;
